-- Volcando estructura para procedimiento integrador_triggers_procedimientos_funciones.Inscripciones
DELIMITER //
CREATE DEFINER=`root`@`localhost` PROCEDURE `Inscripciones`()
    NO SQL
BEGIN
	SELECT sedes.sede_nombre, carreras.nombre, fset2019.fecha_examen, materias.nombre, alumnos.nombre, fset2019.estado
	FROM regularidad
	INNER JOIN carreras ON regularidad.id_carrera = carreras.id
	INNER JOIN alumnos ON regularidad.id_alumno = alumnos.id
	INNER JOIN sedes ON regularidad.id_sede = sedes.sede_id
	INNER JOIN materias ON regularidad.id_materia = materias.id
	INNER JOIN fset2019 ON regularidad.id_alumno = fset2019.id_alumno AND regularidad.id_sede = fset2019.id_sede AND regularidad.id_materia = fset2019.id_materia
	WHERE fset2019.estado = 'I';  
END//
DELIMITER ;

