SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='NO_AUTO_VALUE_ON_ZERO';
DELIMITER //
CREATE TRIGGER `validacion_inscripcion_mesas` BEFORE INSERT ON `fset2019` FOR EACH ROW BEGIN

IF EXISTS(SELECT id_alumno, id_sede, id_materia, ciclo_lectivo, estado FROM regularidad WHERE id_alumno = NEW.id_alumno AND id_sede = NEW.id_sede AND id_materia = NEW.id_materia AND ciclo_lectivo <= (SELECT YEAR(NEW.fecha_examen) - 2) AND estado = 'R')
THEN    	
		SET NEW.id_sede = NEW.id_sede;
		SET NEW.id_materia = NEW.id_materia;
		SET NEW.id_alumno = NEW.id_alumno;
		SET NEW.fecha_examen = NEW.fecha_examen;
		SET NEW.estado = 'I';
ELSE
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'El alumno no cumple con las condiciones';
END IF;
END//
DELIMITER ;
